import React from 'react'
import { Button, Typography } from '@mui/material'

const QuestionButton = ({text, onClick}) => {
    return (
        <Button
            sx={{ 
                minWidth: '400px',
                minHeight: '400px'
            }}
            variant="text"
            onClick={onClick}
        >
            <Typography variant="h8">
                {text}
            </Typography>
        </Button>
    )
}

export default QuestionButton
